const categories = [
    {
        "id" : 'C1',
        "title": "OVERHEAD PLATE BOOK",
        "imageUrl" : ''
    },
    {
        "id" : 'C2',
        "title": "UNDERGROUND PLATE BOOK",
        "imageUrl" : ''
    },
    {
        "id" : 'C3',
        "title": "DESIGN MANUAL",
        "imageUrl" : ''
    },
]

const Home = () => {
    return(
        <div>
            {categories.map((category) =>(
            <h1 key={category.id}>{category.title}</h1>
        ))}
        </div>
    )
};

export default Home;
